  false,\n\t\"url\": null,\n\t\"notes\": \"This annual narrative report for Northwest
  Montana Wetland Management District outlines Refuge accomplishments during the 1975
  fiscal year. The report begins by summarizing the weather conditions, habitat conditions,
  water conditions, and food and cover conditions during the year. Wildlife- including
  migratory birds, upland game birds, big game animals, furbearers, predators, rodents,
  raptors, fish, and reptiles- is also covered. The Refuge development and maintenance
  section discusses physical developments, plantings, and vegetation control. Resource
  management is outlined; topics include grazing, haying, and timber removal. A progress
  report on field investigations and applied research is also provided. The public
  relations section of the report describes recreational uses, hunting, fishing, violations,
  and safety. N-R forms are attached.\",\n\t\"owner_org\": \"4d7ad1cd-3641-420b-8116-e4082f49cd44\",\n\t\"extras\":
